INSERT INTO `catalog_pages` VALUES ('153', '152', 'set_vikingos', 'Vikings', '208', '1', '1', '1', '0', '1', 'default_3x3', 'vikings_catalog_header', 'catalog_teaser_vikings', '', 'Armas y cabezas con pinchos para aterrorizar al adversario, sillas de madera talladas y adornadas a mano, bancos robustos... Este lote tiene todo lo que necesitas para crear una verdadera aldea vikinga. Disponibles los furnis con colores de cada clan, ¡así podrás seguir mostrando tu lealtad con orgullo!', '', '', '', '0', '', '');
INSERT INTO `catalog_pages` VALUES ('127', '2', 'set_cannons', 'Canhões', '190', '1', '1', '1', '0', '1', 'default_3x3', '', 'ship_bundle1_teaser', 'catalog_special_txtbg2', '¡Arrgh! ¡Han llegado los cañones! Actívalos con Wired y ¡kabúm! ¡Los Habbos que pasen frente al cañón y reciban la munición serán kickeados! ¿Eso es todo? Por supuesto que no, arrgh... Activa el volumen y podrás escuchar el sonido de la explosión del cañón.', '', '', '¡Se activan sólo con Wired!', '0', '', '');
INSERT INTO `catalog_pages` VALUES ('155', '190', 'vip_culturamundial', 'Cultura Mundial', '838', '1', '1', '1', '0', '5', 'default_3x3', 'ctlg_buy_vip_header', 'habbo_painting', '', 'Esto no es cualquier arte. Los VIPs tienen disponibles una selección de los cuadros más valiosos en INUX. Adorna tus Salas con caballetes curiosos y pinturas que le darán un toque artístico a tu Sala. Si eres VIP, ¡no optes por los pósters básicos!', '', '', '', '0', '', '');
