INSERT INTO `catalog_pages` VALUES ('157', '-1', 'weekly_bundle', 'Mobi da Semana', '206', '0', '0', '1', '0', '1', 'single_bundle', 'cinema_catalogheader', 'cine_roombundle_xml', '', 'Esta semana: \"Lote Sala de Cine\"', '', 'Baja las persianas, apaga las luces y ataca el cuenco de palomitas... El Lote Sala de Cine viene cargado hasta los topes con todo lo que un gran cinéfilo puede desear. ¡PLACA EXCLUSIVA incluida!', '<font color=\"#DF7401\" size=\"16\"><i><b>Lo que incluye:</b></i></font>', '0', '', '');
INSERT INTO `catalog_pages` VALUES ('182', '180', 'guild_forum', 'Fóruns de Grupo', '207', '1', '1', '1', '0', '0', 'guild_forum', 'catalog_groups_es', '', '', '¡Los Foros de Grupo ya estÃ¡n aquÃ­!', '<i><b><font color=\"#0e3f52\" size=\"16\">Â¿QuÃ© es un foro de grupo?</font></b></i>\r\n\r\nLos Foros te permiten publicar, comentar y discutir temas libremente, Â¡y sin tener que dejar el Hotel!\r\n\r\n<i><b><font color=\"#0e3f52\" size=\"16\">Â¿QuiÃ©n puede activar un foro? </font></b></i>\r\n\r\nSolo el dueÃ±o de un grupo puede activar un foro.\r\n\r\n<i><b><font color=\"#0e3f52\" size=\"16\">Â¿Necesito un Panel de Foro?</font></b></i>\r\n\r\nSÃ­. Para poder empezar un Foro de Grupo el dueÃ±o tiene que comprar el Panel de Foro.\r\n\r\n\r\nPara mÃ¡s informaciÃ³n sobre los Foros de Grupo pincha <a href=\"event:habbopages/forums\">aquÃ­</a>.\r\n\r\n\r\nPrÃ³ximamente iremos aÃ±adiendo nuevas funcionalidades a esta herramienta.\r\nFinn', '', ' ', '0', '', '');
INSERT INTO `catalog_pages` VALUES ('1', '-1', 'front_page', 'Inicio', '1', '1', '1', '1', '0', '0', 'frontpage', 'catalog_frontpage_headline_shop_ES', 'frontpage_teaser', '', '<i><b><font color=\"#0E668C\" size=\"16\">¿Qué puedo encontrar en la tienda?</font></b></i><br><br>Sea lo que sea lo que te guste hacer en Habbo, explorando nuestra Tienda lo pasarás mejor.<br><br><li>Unirme a <a href=\"event:catalog/open/habbo_club\">Habbo Club</a></li><li><a href=\"event:catalog/open/set_pixelnew\">Decorar </a> tu habitación </li><li>Adoptar una <a href=\"event:catalog/open/pet_horse\">Mascota</a>, <a href=\"event:catalog/open/bots\">Bot</a> o <a href=\"event:catalog/open/monster_plants_info\">Monsterplants</a></li><li>Haz tu propios <a href=\"event:catalog/open/category_wired\">Wired</a> juegos</li><li>Tradea en nuestro <a href=\"event:catalog/open/marketplace_offers\">Marketplace</a></li><br><i><b><font color=\"#0E668C\" size=\"16\">¿Dónde puedo conseguir créditos? </font></b></i><br><br>Tenemos muchos métodos de pago, tales como SMS, Teléfono, Tarjetas Prepago y Tarjeta de Crédito <br><br><a href=\"http://v3.inux.es/nuxeros\">Visita nuestra página de Nuxeros para más info.</a>', 'Canjea tu código aquí:', '', '', '0', '', '');
